import React, { useEffect } from 'react';

const GenerateWebData = () => {
  useEffect(() => {
    const generateData = async () => {
      try {
        const response = await fetch('https://qs4ng286xa.execute-api.us-east-1.amazonaws.com/omnis-web-data-gen-latest', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify({
            event_type: "web_data_new",
            event_types: ["page_view", "add_to_cart", "purchase"],
            num_users: 100,
            num_events: 100,
            time_range_days: 30,
            output_format: "json",
            email: "your-email@example.com", // Replace with actual email
            sandbox: "sandbox123",
            schema_id: "schema_xyz_001",
            user_prompt: "Generate basic commerce analytics data for testing"
          }),
        });

        const result = await response.json();
        console.log('API response:', result);
      } catch (error) {
        console.error('Error calling API:', error);
      }
    };

    generateData();
  }, []);

  return <div>Generating Web Data... Check console for response.</div>;
};

export default GenerateWebData;
